import React from 'react'
import { Col,Row, Container } from 'react-bootstrap'
import '../App.css'
import {LinkContainer} from 'react-router-bootstrap'
import { useParams } from 'react-router'

import { Card } from 'react-bootstrap';

const SecondScreenCard = ({secondscreen}) => {
  return (
    <Card className="text-white s-screen-card my-4 text-center">
    <Card.Img src='' alt="Card image" />
<Card.ImgOverlay>
    <Card.Title className="ss-card-title" style={{fontSize:'40px',textShadow:"2px 7px 5px rgba(0,0,0,0.3),0px -4px 10px rgba(255,255,255,0.3)"}}></Card.Title>
    <LinkContainer to='/'>
       <button className="ss-card-button">Explore</button>
    </LinkContainer>
    
</Card.ImgOverlay>
</Card>
  );
};

export default SecondScreenCard;
